import { useState } from "react";

const SubmitButton =()=>{

    const [nameInput, setNameInput] = useState('');

    const onNameChangeHandler=(event)=>{
        setNameInput(event.target.value);
        return(
            console.log("In onNameChangeHandler")
        );
    }

    const onSubmittingValues=(event)=>{
        event.preventDefault();
        console.log("In onSubmittingValues");
        return(
            console.log(nameInput)
        );
    }

        return(

            <div className="main-box">
                <form onSubmit={onSubmittingValues}>
                    <div className="box1">
                    
                        <label htmlFor="username"> Name </label> 
                        <input name="username" type= "text" onChange={onNameChangeHandler} />
        
                        <label htmlFor="userage"> Age </label>
                        <input name="userage" type= "number"  />

                        <div className="btn" >
                            <button type="submit">SUBMIT</button>
                        </div>
                   </div>
                </form>
            </div>
        );
}

export default SubmitButton;
